import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { apiUrl } from "../axios"; // Ensure this is the correct API URL

const Register = () => {
  const [formData, setFormData] = useState({
    first_name: '',
    last_name: '',
    username: '',
    mobile_no: '',
    email: '',
    password: '',
    cpassword: ''
  });
  const [formError, setFormError] = useState({});
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // Validate password matching
    if (formData.password !== formData.cpassword) {
      setFormError({ password: "Passwords do not match" });
      return;
    }

    try {
      const response = await axios.post(`${apiUrl}/register/`, formData);
      console.log(response.data); // Log success response
      setMessage(response.data.message);
    } catch (error) {
      console.error('Error:', error); // Log error for debugging
      setMessage(error.response?.data?.error || "Something went wrong.");
    }
  };

  // Inner CSS styles
  const styles = {
    container: {
      height: "100vh",
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      background: "linear-gradient(135deg, #f5f7fa, #c3cfe2)",
    },
    formContainer: {
      width: "430px",
      height: "auto",
      boxShadow: "4px 4px 15px rgba(0, 0, 0, 0.2)",
      backgroundColor: "#ffffff",
      padding: "40px",
      borderRadius: "15px",
      border: "2px solid #007bff",
    },
    header: {
      fontSize: "30px",
      color: "#007bff",
      textAlign: "center",
    },
    label: {
      display: "inline-block",
      width: "150px",
      textAlign: "right",
      marginRight: "10px",
    },
    input: {
      fontSize: "16px",
      padding: "10px",
      border: "1px solid #ccc",
      borderRadius: "8px",
      width: "100%", // Makes input full width
    },
    button: {
      width: "50%",
      fontSize: "17px",
      padding: "10px 20px",
      backgroundColor: "#007bff",
      border: "none",
      borderRadius: "7px",
    },
    errorText: {
      color: "red",
      fontSize: "14px",
    },
  };

  return (
    <div style={styles.container}>
      <div className="container mt-5" style={styles.formContainer}>
        <form onSubmit={handleSubmit} method="post" className="form">
          <div className="row mt-3 mb-3">
            <h2 className="text-center" style={styles.header}>
              <i className="bi bi-person-plus px-3"></i>Register
            </h2>
          </div>

          {/* First Name */}
          <div style={{ marginBottom: "20px" }}>
            <label htmlFor="first_name" style={styles.label}>
              First Name:
            </label>
            <input
              required
              type="text"
              name="first_name"
              id="first_name"
              placeholder="Enter your first name"
              className="form-control"
              style={styles.input}
              onChange={handleChange}
            />
          </div>

          {/* Last Name */}
          <div style={{ marginBottom: "20px" }}>
            <label htmlFor="last_name" style={styles.label}>
              Last Name:
            </label>
            <input
              type="text"
              name="last_name"
              id="last_name"
              placeholder="Enter your last name"
              className="form-control"
              style={styles.input}
              onChange={handleChange}
            />
          </div>

          {/* Username */}
          <div style={{ marginBottom: "20px" }}>
            <label htmlFor="username" style={styles.label}>
              Username:
            </label>
            <input
              required
              type="text"
              name="username"
              id="username"
              placeholder="Enter your username"
              className="form-control"
              style={styles.input}
              onChange={handleChange}
            />
          </div>

          {/* Mobile Number */}
          <div style={{ marginBottom: "20px" }}>
            <label htmlFor="mobile" style={styles.label}>
              Mobile Number:
            </label>
            <input
              required
              type="text"
              name="mobile_no"
              id="mobile"
              placeholder="Enter your mobile number"
              title="Please enter a valid phone number"
              className="form-control"
              style={styles.input}
              onChange={handleChange}
            />
            <p style={styles.errorText}>{formError.mobile_no}</p>
          </div>

          {/* Email */}
          <div style={{ marginBottom: "20px" }}>
            <label htmlFor="email" style={styles.label}>
              Email:
            </label>
            <input
              required
              type="email"
              name="email"
              id="email"
              placeholder="Enter your email"
              className="form-control"
              style={styles.input}
              onChange={handleChange}
            />
          </div>

          {/* Password */}
          <div style={{ marginBottom: "20px" }}>
            <label htmlFor="password" style={styles.label}>
              Password:
            </label>
            <input
              required
              type="password"
              name="password"
              id="password"
              placeholder="Enter your password"
              title="Must contain at least one number, one uppercase, and lowercase letter, and be at least 8 characters long"
              className="form-control"
              style={styles.input}
              onChange={handleChange}
            />
          </div>

          {/* Confirm Password */}
          <div style={{ marginBottom: "20px" }}>
            <label htmlFor="cpassword" style={styles.label}>
              Confirm Password:
            </label>
            <input
              required
              type="password"
              name="cpassword"
              id="cpassword"
              placeholder="Confirm your password"
              className="form-control"
              style={styles.input}
              onChange={handleChange}
            />
            <p style={styles.errorText}>{formError.password}</p>
          </div>

          {/* Submit Button */}
          <div className="text-center">
            <button
              type="submit"
              className="btn btn-dark"
              style={styles.button}
            >
              Register
            </button>
          </div>
        </form>
        {/* Optional: Display message from server */}
        {message && <p style={styles.errorText}>{message}</p>}
      </div>
    </div>
  );
};

export default Register;
